import React, { useState } from 'react';
import { Grid } from '@material-ui/core';
import { Card, CardMedia } from '@material-ui/core';
import { Button, CardActions, CardContent, Typography } from '@material-ui/core';

const Cardetail = (car) => {

    const [cardetail, setCardetails] = useState(car.location.state.car);
    console.log(cardetail);

    //make card component with car description


    return (
        <>
            <Grid container justify="space-between" spacing={2} style={{ padding: '30px', width: "100%", height: "553px", backgroundColor: "red" }} >
                <Grid item xs={12} md={8} >
                    <Card container style={{ color: 'red', backgroundColor: '#f1f1f1' }} >
                        <CardMedia
                            component="img"
                            height="490"
                            width="100px"
                            image={cardetail.carImages}
                            alt="Car img"
                        />
                    </Card>
                </Grid>
                <Grid item xs={12} md={4} >
                    <Card sx={{ maxWidth: 345 }}>
                        <CardContent >
                            <Typography gutterBottom variant="h4" justifyContent >
                                Description
                            </Typography>
                            <Typography gutterBottom variant="h6" >
                                Brand Name: {cardetail.brand}
                            </Typography>

                            <Typography gutterBottom variant="h6" >
                                Model Name:  {cardetail.brand}
                            </Typography>

                            <Typography gutterBottom variant="h6" >
                                Registration Year:  {cardetail.brand}
                            </Typography>

                            <Typography gutterBottom variant="h6" >
                                Transmission Type:  {cardetail.brand}
                            </Typography>

                            <Typography gutterBottom variant="h6" >
                                Fuel Type:  {cardetail.brand}
                            </Typography>

                            <Typography gutterBottom variant="h6" >
                                Registration State:  {cardetail.brand}
                            </Typography>
                            <Typography gutterBottom variant="h6" >
                                Price:  {cardetail.brand}
                            </Typography>







                            <Typography variant="body2" color="text.secondary">
                               Small description about the car
                            </Typography>
                        </CardContent>
                        <CardActions>
                            <Button size="small">Read More</Button>
                        </CardActions>
                    </Card>

                </Grid>

            </Grid>
        </>
    )
}

export default Cardetail;
